// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SimpleWallet {
    address public owner;

    // Evento per notificare un deposito
    event Deposit(address indexed sender, uint amount);

    // Evento per notificare un prelievo
    event Withdrawal(address indexed receiver, uint amount);

    // Modificatore per limitare l'accesso solo al proprietario
    modifier onlyOwner() {
        require(msg.sender == owner, "Non sei il proprietario!");
        _;
    }

    // Costruttore per inizializzare il contratto con l'indirizzo del proprietario
    constructor() {
        owner = msg.sender;
    }

    // Funzione per depositare fondi nel contratto
    function deposit() public payable {
        require(msg.value > 0, "Devi inviare un valore maggiore di 0");
        emit Deposit(msg.sender, msg.value);
    }

    // Funzione per prelevare fondi (solo il proprietario può farlo)
    function withdraw(uint amount) public onlyOwner {
        require(amount <= address(this).balance, "Fondi insufficienti");
        payable(msg.sender).transfer(amount);
        emit Withdrawal(msg.sender, amount);
    }

    // Funzione per controllare il saldo del contratto
    function getBalance() public view returns (uint) {
        return address(this).balance;
    }
}
